import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './styles.css'; // Custom styles for animations

const About = () => {
  return (
    <section id="about" className="py-5">
      <div className="container">
        {/* Row 1: Image on the left, Content on the right */}
        <div className="row align-items-center mb-5">
          <div className="col-md-6">
            <img src="path/to/image1.jpg" alt="About Us" className="img-fluid animate__animated animate__fadeInLeft" />
          </div>
          <div className="col-md-6">
            <h2 className="animate__animated animate__fadeInRight">About Us</h2>
            <p className="animate__animated animate__fadeInRight">We are committed to providing the best services.</p>
            <p className="animate__animated animate__fadeInRight">Our team is dedicated to excellence and innovation in every project.</p>
          </div>
        </div>

        {/* Row 2: Content on the left, Image on the right */}
        <div className="row align-items-center">
          <div className="col-md-6 order-md-2">
            <img src="/assets/8.png" alt="Our Mission" className="img-fluid animate__animated animate__fadeInRight" />
          </div>
          <div className="col-md-6">
            <h2 className="animate__animated animate__fadeInLeft">Our Mission</h2>
            <p className="animate__animated animate__fadeInLeft">Delivering high-quality solutions to our clients.</p>
            <p className="animate__animated animate__fadeInLeft">Fostering a culture of innovation and collaboration.</p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
